import React from 'react';
import { NavLink } from 'react-router-dom';

export default function SidebarMenuItem(props) {
  return (
    <li>
      <NavLink to='/'>
        <img src={props.icon} alt={props.name} /> {props.name}
      </NavLink>
    </li>
  );
}
